import React from 'react';

function JobCard({ job }) {
  return (
    <div className="JobCard card">
      <div className="card-body">
        <h6 className="card-title">{job.title}</h6>
        <p>{job.companyName}</p>
      </div>
    </div>
  );
}

export default JobCard;
